DROP TABLE IF EXISTS `tab_device`;
CREATE TABLE `tab_device` (
  `device_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `device_no` varchar(64) NOT NULL DEFAULT '' COMMENT '设备唯一标识',
  `plate_number` varchar(30) DEFAULT '' COMMENT '绑定车牌',
  `create_time` datetime DEFAULT NULL COMMENT '激活时间',
  `activation_status` int(11) DEFAULT '1' COMMENT '激活状态 1 激活 0 未激活',
  `user_deadline_time` datetime DEFAULT NULL COMMENT '授权截止日期',
  `sell_type_id` int(11) NOT NULL DEFAULT '0' COMMENT '销售类型',
  `coach_id` bigint(20) DEFAULT '0' COMMENT '所属教练',
  `device_type_id` int(11) DEFAULT '0' COMMENT '设备类型',
  `sim_card` varchar(32) DEFAULT '' COMMENT 'Sim卡',
  `charge_type_id` int(11) DEFAULT '0' COMMENT '收费模式',
  `deposit` decimal(18,2) DEFAULT '0.00' COMMENT '押金',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登录时间',
  `last_login_ip` varchar(30) DEFAULT '' COMMENT 'last_login_ip',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '状态1:正常，0:禁止',
  `test_status` int(11) NOT NULL DEFAULT '0' COMMENT '考试状态，0：未进行，1：教练扫描确认，2：学员扫描确认，3：设备确认开始进行考试，考试结束回到1，如果教练注销则回到0； ',
