  `test_student_id` bigint(20) DEFAULT '0' COMMENT '考试的学员id',
  `remarks` varchar(255) DEFAULT '' COMMENT '主要应用在代理商激活设备时自行填写，在代理商后台查询时可以根据此字段模糊查询，比如备注教练A，后台模糊查询可以查出所有备注教练A的所有设备',
  `free_time` int(11) DEFAULT '120' COMMENT '免费时长单位分钟',
  `total_test_time` int(11) DEFAULT '0' COMMENT '总的考试时长(秒)',
  `total_test_income` decimal(18,2) DEFAULT '0.00' COMMENT '总的考试收入（元）',
  `total_test_pay` decimal(18,2) DEFAULT '0.00' COMMENT '总的已支付金额（元）',
  PRIMARY KEY (`device_id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COMMENT='4.5 设备表';

