DROP TABLE IF EXISTS `tab_top_agent_account`;
CREATE TABLE `tab_top_agent_account` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `top_agent_id` bigint(20) DEFAULT '0' COMMENT '顶级代理商id',
  `top_agent_name` varchar(64) DEFAULT '' COMMENT '顶级名称',
  `account` varchar(64) DEFAULT '' COMMENT '账号（微信号）',
  `order_id` bigint(20) DEFAULT '0' COMMENT '订单id',
  `test_id` bigint(20) DEFAULT '0' COMMENT '考试id',
  `test_time` datetime DEFAULT NULL COMMENT '考试时间',
  `plate_number` varchar(32) DEFAULT '' COMMENT '考试车牌',
  `test_money` decimal(18,2) DEFAULT '0.00' COMMENT '考试金额',
  `separate_money` decimal(18,2) DEFAULT '0.00' COMMENT '分账金额',
  `separate_status` int(11) DEFAULT '0' COMMENT '顶级代理商分账是否成功 0初始值，1成功，2失败，3：处理中，以后再查。1，2是调用企业付款得结果，3是查询企业付款得到的结果',
  `separate_remark` varchar(255) DEFAULT '' COMMENT '分成失败原因',
  `separate_order_no` varchar(64) DEFAULT '' COMMENT '顶级代理商分账得订单号',
  `separate_payment_no` varchar(64) DEFAULT '' COMMENT '企业付款成功，返回的微信付款单号',
  `create_time` datetime DEFAULT NULL COMMENT '记录时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COMMENT='4.13 顶级代理商分账记录表';

