-- ----------------------------
-- Table structure for tab_trainingground
-- ----------------------------
DROP TABLE IF EXISTS `tab_trainingground`;
CREATE TABLE `tab_trainingground` (
  `tg_coach_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `tg_name` varchar(64) NOT NULL COMMENT '训练场名称',
  `account` varchar(64) NOT NULL DEFAULT '' COMMENT '账号（手机号，必须唯一）',
  `coach_name` varchar(64) DEFAULT '' COMMENT '教练名称',
  `sex` int(4) DEFAULT '0' COMMENT '性别，0男，1女',
  `headimg` varchar(255) DEFAULT '' COMMENT '头像地址, 微信授权之后从微信上获取',
  `tel` varchar(16) DEFAULT '' COMMENT '联系电话',
  `divide` decimal(18,2) DEFAULT '0.00' COMMENT '分成比例',
  `create_time` datetime NOT NULL COMMENT '注册时间',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登录时间',
  `last_login_ip` varchar(30) DEFAULT '' COMMENT 'last_login_ip',
  `remarks` varchar(255) DEFAULT '' COMMENT '备注',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '状态1:正常，0:禁止',
  `openid` varchar(64) DEFAULT '' COMMENT '微信授权之后从微信上获取',
  `unionid` varchar(64) DEFAULT '' COMMENT '微信授权之后从微信上获取',
  `wechat_name` varchar(64) DEFAULT '' COMMENT '微信授权之后从微信上获取',
  `amount_desirable` decimal(18,2) DEFAULT '0.00' COMMENT '可取金额，费用分账失败后加入这个字段，可以申请提现，平台线下手动转账',
  `amount_freeze` decimal(18,2) DEFAULT '0.00' COMMENT '申请提现金额，申请提现后的金额，如果提现成功则减相应的金额，同时累加到已提现金额，如果提现失败也要减相应的金额，但同时相应的金额要返还到可取金额',
  `amount_withdraw` decimal(18,2) DEFAULT '0.00' COMMENT '已提现金额',
  `charge_type` int(11) DEFAULT '1' COMMENT '收费类型,1:按小时，2：按次数，3：按圈数',
  `charge_rate` decimal(18,2) DEFAULT '60.00' COMMENT '费率（元/小时，或者元/次',
  PRIMARY KEY (`tg_coach_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='4.1 训练场教练表';

-- ----------------------------
-- Records of tab_trainingground
-- ----------------------------

-- ----------------------------
-- Table structure for tab_withdraw_apply
-- ----------------------------
DROP TABLE IF EXISTS `tab_withdraw_apply`;
CREATE TABLE `tab_withdraw_apply` (
  `apply_id` int(11) NOT NULL AUTO_INCREMENT,
  `apply_type` int(11) NOT NULL COMMENT '提现类型0：教练员，1：代理商，2：顶级代理商',
  `applicant_id` bigint(20) NOT NULL COMMENT '提现人id，根据提现类型判断，分别对应教练员id，代理商id，顶级代理商id',
  `amount_apply` decimal(18,2) DEFAULT '0.00' COMMENT '申请提现金额',
  `apply_time` datetime DEFAULT NULL,
  `dispose_state` int(11) NOT NULL DEFAULT '0' COMMENT '处理状态,0:申请中，1：提现成功，2：提现失败；',
  `remarks` varchar(255) DEFAULT '' COMMENT '备注',
  `check_time` datetime DEFAULT NULL COMMENT '审核日期',
  PRIMARY KEY (`apply_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of tab_withdraw_apply
-- ----------------------------

-- ----------------------------
-- Table structure for tab_wxuser
-- ----------------------------
DROP TABLE IF EXISTS `tab_wxuser`;
CREATE TABLE `tab_wxuser` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `openid` varchar(100) NOT NULL COMMENT 'openid',
  `nickname` varchar(255) DEFAULT NULL COMMENT '昵称',
  `headimgurl` varchar(255) DEFAULT NULL COMMENT '头像',
  `unionid` varchar(200) DEFAULT NULL COMMENT '公众号用户唯一的编号 ',
  `sex` int(10) DEFAULT NULL COMMENT '性别',
  `language` varchar(255) DEFAULT NULL COMMENT '语言',
  `city` varchar(255) DEFAULT NULL COMMENT '城市',
  `country` varchar(255) DEFAULT NULL COMMENT '国家',
  `province` varchar(255) DEFAULT NULL COMMENT '省份',
  `subscribe` int(2) DEFAULT '0' COMMENT '是否关注',
  `create_time` datetime DEFAULT NULL COMMENT '注册时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `open_index` (`openid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4;

